@oasisprotocol/sapphire-contracts/contra.content:
// SPDX-License-Identifier: Apache-2.0
pragma solidity ^0.8.0;

/**
 * @title Sapphire
 * @notice This library provides a number of convenient wrappers for
 * cryptographic operations such as the x25519 key derivation, Deoxys-II-based
 * encryption and decryption, signing key generation, message digest signing and
 * verification, gas padding and hashing.
 *
 * Most of the mentioned functions are implemented as Sapphire's precompiles and
 * are cheap to call.
 *
 * #### Calling Precompiles Manually
 *
 * You can override the wrappers and call Sapphire precompiles by dispatching
 * calls to specific well-known contract addresses, as described below. The
 * __Precompile address__ section of each function will show you the address
 * of the corresponding precompile.
 *
 * Input parameters should be packed into a contiguous memory region with each
 * chunk of data padded to 32 bytes as usual. The recommended way to construct
 * parameter byte sequences in Solidity is with `abi.encode` and `abi.decode`,
 * which will transparently handle things like putting `bytes` lengths in the
 * correct position.
 */
library Sapphire {
    // Oasis-specific, confidential precompiles
    address internal constant RANDOM_BYTES =
        0x0100000000000000000000000000000000000001;
    address internal constant DERIVE_KEY =
        0x0100000000000000000000000000000000000002;
    address internal constant ENCRYPT =
        0x0100000000000000000000000000000000000003;
    address internal constant DECRYPT =
        0x0100000000000000000000000000000000000004;
    address internal constant GENERATE_SIGNING_KEYPAIR =
        0x0100000000000000000000000000000000000005;
    address internal constant SIGN_DIGEST =
        0x0100000000000000000000000000000000000006;
    address internal constant VERIFY_DIGEST =
        0x0100000000000000000000000000000000000007;
    address internal constant CURVE25519_PUBLIC_KEY =
        0x0100000000000000000000000000000000000008;
    address internal constant GAS_USED =
        0x0100000000000000000000000000000000000009;
    address internal constant PAD_GAS =
        0x010000000000000000000000000000000000000a;

    // Oasis-specific, general precompiles
    address internal constant SHA512_256 =
        0x0100000000000000000000000000000000000101;
    address internal constant SHA512 =
        0x0100000000000000000000000000000000000102;
    address internal constant SHA384 =
        0x0100000000000000000000000000000000000104;

    type Curve25519PublicKey is bytes32;
    type Curve25519SecretKey is bytes32;

    enum SigningAlg {
        /// Ed25519 signature over the provided message using SHA-512/265 with a domain separator.
        /// Can be used to sign transactions for the Oasis consensus layer and SDK paratimes.
        Ed25519Oasis,
        /// Ed25519 signature over the provided message.
        Ed25519Pure,
        /// Ed25519 signature over the provided prehashed SHA-512 digest.
        Ed25519PrehashedSha512,
        /// Secp256k1 signature over the provided message using SHA-512/256 with a domain separator.
        /// Can be used to sign transactions for the Oasis consensus layer and SDK paratimes.
        Secp256k1Oasis,
        /// Secp256k1 over the provided Keccak256 digest.
        /// Can be used to sign transactions for Ethereum-compatible networks.
        Secp256k1PrehashedKeccak256,
        /// Secp256k1 signature over the provided SHA-256 digest.
        Secp256k1PrehashedSha256,
        /// Sr25519 signature over the provided message.
        Sr25519,
        /// Secp256r1 signature over the provided SHA-256 digest.
        Secp256r1PrehashedSha256,
        /// Secp384r1 signature over the provided SHA-384 digest.
        Secp384r1PrehashedSha384
    }

    /**
     * @notice Generate `num_bytes` pseudo-random bytes, with an optional
     * personalization string (`pers`) added into the hashing algorithm to
     * increase domain separation when needed.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000001`
     *
     * #### Gas cost
     *
     * 10,000 minimum plus 240 per output word plus 60 per word of the
     * personalization string.
     *
     * #### Implementation details
     *
     * The mode (e.g. simulation or "view call" vs transaction execution) is fed
     * to TupleHash (among other block-dependent components) to derive the "key
     * id", which is then used to derive a per-block VRF key from
     * epoch-ephemeral entropy (using KMAC256 and cSHAKE) so a different key
     * id will result in a unique per-block VRF key. This per-block VRF key is
     * then used to create the per-block root RNG which is then used to derive
     * domain-separated (using Merlin transcripts) per-transaction random RNGs
     * which are then exposed via this precompile. The KMAC, cSHAKE and
     * TupleHash algorithms are SHA-3 derived functions defined in [NIST
     * Special Publication 800-185](https://nvlpubs.nist.gov/nistpubs/specialpublications/nist.sp.800-185.pdf).
     *
     * #### Example
     *
     * ```solidity
     * bytes memory randomPad = Sapphire.randomBytes(64, "");
     * ```
     *
     * @param numBytes The number of bytes to return.
     * @param pers An optional personalization string to increase domain
     *        separation.
     * @return The random bytes. If the number of bytes requested is too large
     *         (over 1024), a smaller amount (1024) will be returned.
     */
    function randomBytes(uint256 numBytes, bytes memory pers)
        internal
        view
        returns (bytes memory)
    {
        (bool success, bytes memory entropy) = RANDOM_BYTES.staticcall(
            abi.encode(numBytes, pers)
        );
        require(success, "randomBytes: failed");
        return entropy;
    }

    /**
     * @notice Generates a Curve25519 keypair.
     * @param pers An optional personalization string used to add domain
     * separation.
     * @return pk The Curve25519 public key. Useful for key exchange.
     * @return sk The Curve25519 secret key. Pairs well with
     * [deriveSymmetricKey](#derivesymmetrickey).
     */
    function generateCurve25519KeyPair(bytes memory pers)
        internal
        view
        returns (Curve25519PublicKey pk, Curve25519SecretKey sk)
    {
        bytes memory scalar = randomBytes(32, pers);
        // Twiddle some bits, as per RFC 7748 ยง5.
        scalar[0] &= 0xf8; // Make it a multiple of 8 to avoid small subgroup attacks.
        scalar[31] &= 0x7f; // Clamp to < 2^255 - 19
        scalar[31] |= 0x40; // Clamp to >= 2^254
        (bool success, bytes memory pkBytes) = CURVE25519_PUBLIC_KEY.staticcall(
            scalar
        );
        require(success, "gen curve25519 pk: failed");
        return (
            Curve25519PublicKey.wrap(bytes32(pkBytes)),
            Curve25519SecretKey.wrap(bytes32(scalar))
        );
    }

    /**
     * @notice Derive a symmetric key from a pair of keys using x25519.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000002`
     *
     * #### Gas cost
     *
     * 100,000
     *
     * #### Example
     *
     * ```solidity
     * bytes32 publicKey = ... ;
     * bytes32 privateKey = ... ;
     * bytes32 symmetric = Sapphire.deriveSymmetricKey(publicKey, privateKey);
     * ```
     *
     * @param peerPublicKey The peer's public key.
     * @param secretKey Your secret key.
     * @return A derived symmetric key.
     */
    function deriveSymmetricKey(
        Curve25519PublicKey peerPublicKey,
        Curve25519SecretKey secretKey
    ) internal view returns (bytes32) {
        (bool success, bytes memory symmetric) = DERIVE_KEY.staticcall(
            abi.encode(peerPublicKey, secretKey)
        );
        require(success, "deriveSymmetricKey: failed");
        return bytes32(symmetric);
    }

    /**
     * @notice Encrypt and authenticate the plaintext and additional data using
     * DeoxysII.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000003`
     *
     * #### Gas cost
     *
     * 50,000 minimum plus 100 per word of input
     *
     * #### Example
     *
     * ```solidity
     * bytes32 key = ... ;
     * bytes32 nonce = ... ;
     * bytes memory text = "plain text";
     * bytes memory ad = "additional data";
     * bytes memory encrypted = Sapphire.encrypt(key, nonce, text, ad);
     * bytes memory decrypted = Sapphire.decrypt(key, nonce, encrypted, ad);
     * ```
     *
     * @param key The key to use for encryption.
     * @param nonce The nonce. Note that only the first 15 bytes of this
     * parameter are used.
     * @param plaintext The plaintext to encrypt and authenticate.
     * @param additionalData The additional data to authenticate.
     * @return The ciphertext with appended auth tag.
     */
    function encrypt(
        bytes32 key,
        bytes32 nonce,
        bytes memory plaintext,
        bytes memory additionalData
    ) internal view returns (bytes memory) {
        (bool success, bytes memory ciphertext) = ENCRYPT.staticcall(
            abi.encode(key, nonce, plaintext, additionalData)
        );
        require(success, "encrypt: failed");
        return ciphertext;
    }

    /**
     * @notice Decrypt and authenticate the ciphertext and additional data using
     * DeoxysII. Reverts if the auth tag is incorrect.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000004`
     *
     * #### Gas cost
     *
     * 50,000 minimum plus 100 per word of input
     *
     * #### Example
     *
     * ```solidity
     * bytes32 key = ... ;
     * bytes32 nonce = ... ;
     * bytes memory text = "plain text";
     * bytes memory ad = "additional data";
     * bytes memory encrypted = Sapphire.encrypt(key, nonce, text, ad);
     * bytes memory decrypted = Sapphire.decrypt(key, nonce, encrypted, ad);
     * ```
     *
     * @param key The key to use for decryption.
     * @param nonce The nonce. Note that only the first 15 bytes of this
     * parameter are used.
     * @param ciphertext The ciphertext with tag to decrypt and authenticate.
     * @param additionalData The additional data to authenticate against the
     * ciphertext.
     * @return The original plaintext.
     */
    function decrypt(
        bytes32 key,
        bytes32 nonce,
        bytes memory ciphertext,
        bytes memory additionalData
    ) internal view returns (bytes memory) {
        (bool success, bytes memory plaintext) = DECRYPT.staticcall(
            abi.encode(key, nonce, ciphertext, additionalData)
        );
        require(success, "decrypt: failed");
        return plaintext;
    }

    /**
     * @notice Generate a public/private key pair using the specified method and
     * seed. The available methods are items in the
     * [`Sapphire.SigningAlg`](#signingalg) enum. Note, however, that the
     * generation method ignores subvariants, so all three Ed25519-based are
     * equivalent, and all Secp256k1 & Secp256r1 based methods are equivalent.
     * Sr25519 is not available and will return an error.
     *
     * #### Precompile address
     * `0x0100000000000000000000000000000000000005`
     *
     * #### Gas Cost
     *
     * ##### Ed25519: 1,000 gas
     *
     * - `0` (`Ed25519Oasis`)
     * - `1` (`Ed25519Pure`)
     * - `2` (`Ed25519PrehashedSha512`)
     *
     * ##### Secp256k1: 1,500 gas.
     * - `3` (`Secp256k1Oasis`)
     * - `4` (`Secp256k1PrehashedKeccak256`)
     * - `5` (`Secp256k1PrehashedSha256`)
     *
     * ##### Secp256r1: 4,000 gas
     * - `7` (`Secp256r1PrehashedSha256`)
     *
     * ##### Secp384r1: 18,000 gas
     * - `8` (`Secp384r1PrehashedSha384`)
     *
     * #### Key Formats
     *
     * ##### Ed25519
     *
     * Public key: 32 bytes
     * Secret key: 32 bytes
     *
     * ##### Secp256k1 & Secp256r1
     *
     * Public key: 33 bytes, compressed format (`0x02` or `0x03` prefix, then 32
     * byte X coordinate).
     * Secret key: 32 bytes
     *
     * ##### Secp384r1
     *
     * Public key: 49 bytes, compressed format (`0x02` or `0x03` prefix, then 48
     * byte X coordinate).
     * Secret key: 48 bytes
     *
     * #### Example
     *
     * ```solidity
     * bytes memory seed = hex"0123456789abcdef0123456789abcdef0123456789abcdef0123456789abcdef";
     * bytes memory publicKey;
     * bytes memory privateKey;
     * (publicKey, privateKey) = Sapphire.generateSigningKeyPair(Sapphire.SigningAlg.Ed25519Pure, seed);
     * ```
     *
     * @param alg The signing alg for which to generate a keypair.
     * @param seed The seed to use for generating the key pair. You can use the
     * `randomBytes` method if you don't already have a seed.
     * @return publicKey The public part of the keypair.
     * @return secretKey The secret part of the keypair.
     */
    function generateSigningKeyPair(SigningAlg alg, bytes memory seed)
        internal
        view
        returns (bytes memory publicKey, bytes memory secretKey)
    {
        (bool success, bytes memory keypair) = GENERATE_SIGNING_KEYPAIR
            .staticcall(abi.encode(alg, seed));
        require(success, "gen signing keypair: failed");
        return abi.decode(keypair, (bytes, bytes));
    }

    /**
     * @notice Sign a message within the provided context using the specified
     * algorithm, and return the signature. The `context_or_digest` and
     * `messages` parameters change in meaning slightly depending on the method
     * requested. For methods that take a context in addition to the message you
     * must pass the context in the `context_or_digest` parameter and use
     * `message` as expected. For methods that take a pre-existing hash of the
     * message, pass that in `context_or_digest` and leave `message` empty.
     * Specifically the `Ed25519Oasis` and `Secp256k1Oasis` variants take both a
     * context and a message (each are variable length `bytes`), the context
     * serves as a domain separator.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000006`
     *
     * #### Gas cost
     *
     * See below for the method-dependent base cost, plus 8 gas per 32 bytes of
     * context and message except digest.
     *
     * #### Signing algorithms
     *
     * - `0` (`Ed25519Oasis`): 1,500 gas, variable length context and message.
     * - `1` (`Ed25519Pure`): 1,500 gas, empty context, variable length message.
     * - `2` (`Ed25519PrehashedSha512`): 1,500 gas, pre-existing SHA-512 hash
     *   (64 bytes) as context, empty message.
     * - `3` (`Secp256k1Oasis`): 3,000 gas, variable length context and message
     * - `4` (`Secp256k1PrehashedKeccak256`): 3,000 gas, pre-existing hash
     *   (32 bytes) as context, empty message.
     * - `5` (`Secp256k1PrehashedSha256`): 3,000 gas, pre-existing hash (32
     *   bytes) as context, empty message.
     * - `7` (`Secp256r1PrehashedSha256`): 9,000 gas, pre-existing hash (32
     *   bytes) as context, empty message.
     * - `8` (`Secp384r1PrehashedSha384`): 43,200 gas, pre-existing hash (32
     *   bytes) as context, empty message.
     *
     * #### Example
     *
     * ```solidity
     * Sapphire.SigningAlg alg = Sapphire.SigningAlg.Ed25519Pure;
     * bytes memory pk;
     * bytes memory sk;
     * (pk, sk) = Sapphire.generateSigningKeyPair(alg, Sapphire.randomBytes(32, ""));
     * bytes memory signature = Sapphire.sign(alg, sk, "", "signed message");
     * ```
     *
     * @param alg The signing algorithm to use.
     * @param secretKey The secret key to use for signing. The key must be valid
     * for use with the requested algorithm.
     * @param contextOrHash Domain-Separator Context, or precomputed hash bytes.
     * @param message Message to sign, should be zero-length if precomputed hash
     * given.
     * @return signature The resulting signature.
     * @custom:see @oasisprotocol/oasis-sdk :: precompile/confidential.rs :: call_sign
     */
    function sign(
        SigningAlg alg,
        bytes memory secretKey,
        bytes memory contextOrHash,
        bytes memory message
    ) internal view returns (bytes memory signature) {
        (bool success, bytes memory sig) = SIGN_DIGEST.staticcall(
            abi.encode(alg, secretKey, contextOrHash, message)
        );
        require(success, "sign: failed");
        return sig;
    }

    /**
     * @notice Verifies that the provided digest was signed with using the
     * secret key corresponding to the provided private key and the specified
     * signing algorithm.
     *
     * The `method`, `context_or_digest` and `message` parameters have the same
     * meaning as described above in the [sign()](#sign) function.
     *
     * #### Precompile address
     *
     * `0x0100000000000000000000000000000000000007`
     *
     * #### Gas cost
     *
     * The algorithm-specific base cost below, with an additional **8 gas per
     * 32 bytes** of `context` and `message` for the `Ed25519Oasis`,
     * `Ed25519Pure` and `Secp256k1Oasis` algorithms.
     *
     * - `0` (`Ed25519Oasis`): 2,000 gas
     * - `1` (`Ed25519Pure`): 2,000 gas
     * - `2` (`Ed25519PrehashedSha512`): 2,000 gas
     * - `3` (`Secp256k1Oasis`): 3,000 gas
     * - `4` (`Secp256k1PrehashedKeccak256`): 3,000 gas
     * - `5` (`Secp256k1PrehashedSha256`): 3,000 gas
     * - `7` (`Secp256r1PrehashedSha256`): 7,900 gas
     * - `8` (`Secp384r1PrehashedSha384`): 37,920 gas
     *
     * #### Example
     *
     * ```solidity
     * Sapphire.SigningAlg alg = Sapphire.SigningAlg.Secp256k1PrehashedKeccak256;
     * bytes memory pk;
     * bytes memory sk;
     * bytes memory digest = abi.encodePacked(keccak256("signed message"));
     * (pk, sk) = Sapphire.generateSigningKeyPair(alg, Sapphire.randomBytes(32, ""));
     * bytes memory signature = Sapphire.sign(alg, sk, digest, "");
     * require( Sapphire.verify(alg, pk, digest, "", signature) );
     * ```
     *
     * @param alg The signing algorithm by which the signature was generated.
     * @param publicKey The public key against which to check the signature.
     * @param contextOrHash Domain-Separator Context, or precomputed hash bytes
     * @param message The hash of the message that was signed, should be
     * zero-length if precomputed hash was given.
     * @param signature The signature to check.
     * @return verified Whether the signature is valid for the given parameters.
     * @custom:see @oasisprotocol/oasis-sdk :: precompile/confidential.rs :: call_verify
     */
    function verify(
        SigningAlg alg,
        bytes memory publicKey,
        bytes memory contextOrHash,
        bytes memory message,
        bytes memory signature
    ) internal view returns (bool verified) {
        (bool success, bytes memory v) = VERIFY_DIGEST.staticcall(
            abi.encode(alg, publicKey, contextOrHash, message, signature)
        );
        require(success, "verify: failed");
        return abi.decode(v, (bool));
    }

    /**
     * @notice Set the current transactions gas usage to a specific amount
     * @dev Will cause a reversion if the current usage is more than the amount.
     * @param toAmount Gas usage will be set to this amount
     * @custom:see @oasisprotocol/oasis-sdk :: precompile/gas.rs :: call_pad_gas
     *
     */
    function padGas(uint128 toAmount) internal view {
        (bool success, ) = PAD_GAS.staticcall(abi.encode(toAmount));
        require(success, "verify: failed");
    }

    /**
     * @notice Returns the amount of gas currently used by the transaction
     * @custom:see @oasisprotocol/oasis-sdk :: precompile/gas.rs :: call_gas_used
     */
    function gasUsed() internal view returns (uint64) {
        (bool success, bytes memory v) = GAS_USED.staticcall("");
        require(success, "gasused: failed");
        return abi.decode(v, (uint64));
    }
}

/**
 * @notice Hash the input data with SHA-512/256, according to
 * [NIST.FIPS.180-4](https://nvlpubs.nist.gov/nistpubs/FIPS/NIST.FIPS.180-4.pdf).
 *
 * #### Precompile address
 *
 * `0x0100000000000000000000000000000000000102`
 *
 * #### Gas cost
 *
 * 115 gas, then 13 gas per word
 *
 * #### Example
 *
 * ```solidity
 * bytes32 result = sha512_256(abi.encodePacked("input data"));
 * ```
 *
 * #### Warning: SHA-512 vs SHA-512/256 Length-Extension Attacks
 *
 * [SHA-512](function.sha512.md#sha512) is vulnerable to [length-extension
 * attacks](https://en.wikipedia.org/wiki/Length_extension_attack), which are
 * relevant if you are computing the hash of a secret message. The
 * [SHA-512/256](function.sha512_256.md#sha512_256) variant is **not**
 * vulnerable to length-extension attacks.
 *
 * @param input Bytes to hash.
 * @return result 32 byte digest.
 * @custom:standard https://nvlpubs.nist.gov/nistpubs/FIPS/NIST.FIPS.180-4.pdf
 * @custom:see @oasisprotocol/oasis-sdk :: precompile/sha2.rs :: call_sha512_256
 */
function sha512_256(bytes memory input) view returns (bytes32 result) {
    (bool success, bytes memory output) = Sapphire.SHA512_256.staticcall(input);

    require(success, "sha512_256");

    return bytes32(output);
}

/**
 * @notice Hash the input data with SHA-512, according to
 * [NIST.FIPS.180-4](https://nvlpubs.nist.gov/nistpubs/FIPS/NIST.FIPS.180-4.pdf)
 *
 * #### Precompile address
 *
 * `0x0100000000000000000000000000000000000101`
 *
 * #### Warning: SHA-512 vs SHA-512/256 Length-Extension Attacks
 *
 * [SHA-512](function.sha512.md#sha512) is vulnerable to [length-extension
 * attacks](https://en.wikipedia.org/wiki/Length_extension_attack), which are
 * relevant if you are computing the hash of a secret message. The
 * [SHA-512/256](function.sha512_256.md#sha512_256) variant is **not**
 * vulnerable to length-extension attacks.
 *
 * #### Gas Cost
 *
 * 115 gas, then 13 gas per word
 *
 * #### Example
 *
 * ```solidity
 * bytes memory result = sha512(abi.encodePacked("input data"));
 * ```
 *
 * @param input Bytes to hash.
 * @return output 64 byte digest.
 * @custom:standard https://nvlpubs.nist.gov/nistpubs/FIPS/NIST.FIPS.180-4.pdf
 * @custom:see @oasisprotocol/oasis-sdk :: precompile/sha2.rs :: call_sha512
 */
function sha512(bytes memory input) view returns (bytes memory output) {
    bool success;

    (success, output) = Sapphire.SHA512.staticcall(input);

    require(success, "sha512");
}

/**
 * @notice Hash the input data with SHA-384.
 * @param input Bytes to hash.
 * @return output 48 byte digest.
 * @custom:standard https://nvlpubs.nist.gov/nistpubs/FIPS/NIST.FIPS.180-4.pdf
 * @custom:see @oasisprotocol/oasis-sdk :: precompile/sha2.rs :: call_sha384
 */
function sha384(bytes memory input) view returns (bytes memory output) {
    bool success;

    (success, output) = Sapphire.SHA384.staticcall(input);

    require(success, "sha384");
}

contracts/Flag.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@oasisprotocol/sapphire-contracts/contracts/Sapphire.sol";

/**
 * @title Flag Smart Contract
 * @dev A privacy-enhanced smart contract for storing green flags and red flags on Oasis Sapphire
 * @notice This contract allows users to submit, approve, and manage flags about other users
 * @author FlagMeDaddy Team
 */
contract Flag {

    // ============ STRUCTS ============

    /**
     * @dev Structure to store flag information with privacy features
     */
    struct FlagData {
        address from;              // Address of flag submitter
        address to;               // Address of flag recipient
        bool isRedFlag;           // true = red flag (warning), false = green flag (positive)
        string review;            // Public review text
        bytes encryptedReview;    // Encrypted review for privacy
        uint256 timestamp;        // Block timestamp when flag was created
        bool isVisible;          // Whether flag is approved and visible
        bytes32 flagId;          // Unique identifier for the flag
        bool isEncrypted;        // Whether the review is encrypted
        uint8 severity;          // Severity level (1-10, only for red flags)
        string category;         // Category of the flag (e.g., "behavior", "safety", "kindness")
    }

    /**
     * @dev Structure for flag statistics
     */
    struct FlagStats {
        uint256 totalFlags;
        uint256 redFlags;
        uint256 greenFlags;
        uint256 visibleFlags;
        uint256 pendingFlags;
        uint256 averageRating;
    }

    /**
     * @dev Structure for detailed user rating
     */
    struct UserRating {
        uint256 overallScore;           // 0-100 overall rating
        uint256 safetyScore;            // Safety rating based on safety flags
        uint256 behaviorScore;          // Behavior rating
        uint256 communicationScore;     // Communication rating
        uint256 kindnessScore;          // Kindness rating
        uint256 reliabilityScore;       // Reliability rating
        string ratingTier;              // "Excellent", "Good", "Average", "Poor", "Dangerous"
        uint256 totalInteractions;     // Total number of flag interactions
        uint256 positivePercentage;     // Percentage of positive flags
        bool isRecommended;             // Whether user is recommended for matching
    }

    /**
     * @dev Structure for category-based statistics
     */
    struct CategoryStats {
        uint256 totalCount;
        uint256 redCount;
        uint256 greenCount;
        uint256 averageSeverity;
        uint256 categoryScore;          // 0-100 score for this category
    }

    // ============ STATE VARIABLES ============

    mapping(address => FlagData[]) public userFlags;           // Flags received by each user
    mapping(bytes32 => FlagData) public flagById;             // Flag lookup by ID
    mapping(address => mapping(address => bool)) public hasMatched;  // Track if users have matched
    mapping(address => bool) public isVerifiedUser;           // Verified user status
    mapping(address => uint256) public userReputation;        // User reputation score

    // Rating system mappings
    mapping(address => mapping(string => CategoryStats)) public userCategoryStats;  // Category-based stats per user
    mapping(address => UserRating) public userRatings;        // Comprehensive user ratings
    mapping(address => uint256) public lastRatingUpdate;      // Timestamp of last rating calculation

    address public owner;
    uint256 public totalFlagsSubmitted;
    uint256 public totalFlagsApproved;

    // Flag categories
    string[] public flagCategories = [
        "behavior",
        "safety", 
        "communication",
        "kindness",
        "reliability",
        "appearance",
        "interests",
        "values",
        "general"
    ];

    // ============ EVENTS ============

    event FlagSubmitted(
        address indexed from,
        address indexed to,
        bool isRedFlag,
        bytes32 indexed flagId,
        string category
    );

    event FlagApproved(
        address indexed user,
        bytes32 indexed flagId,
        address indexed approver
    );

    event EncryptedFlagSubmitted(
        address indexed from,
        address indexed to,
        bool isRedFlag,
        bytes32 indexed flagId
    );

    event AnonymousFlagSubmitted(
        address indexed to,
        bool isRedFlag,
        bytes32 indexed flagId,
        string category
    );

    event UserVerified(address indexed user);
    event MatchCreated(address indexed user1, address indexed user2);
    event ReputationUpdated(address indexed user, uint256 newReputation);
    event RatingUpdated(address indexed user, uint256 overallScore, string ratingTier);
    event CategoryScoreUpdated(address indexed user, string category, uint256 score);
    event RecommendationStatusChanged(address indexed user, bool isRecommended);

    // ============ MODIFIERS ============

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function");
        _;
    }

    modifier onlyVerified() {
        require(isVerifiedUser[msg.sender], "User must be verified");
        _;
    }

    modifier validAddress(address _addr) {
        require(_addr != address(0), "Invalid address");
        require(_addr != msg.sender, "Cannot flag yourself");
        _;
    }

    modifier hasMatchedWith(address _user) {
        require(hasMatched[msg.sender][_user], "Can only flag users you have matched with");
        _;
    }

    modifier validCategory(string memory _category) {
        require(isValidCategory(_category), "Invalid flag category");
        _;
    }

    // ============ CONSTRUCTOR ============

    constructor() {
        owner = msg.sender;
        isVerifiedUser[msg.sender] = true;
        userReputation[msg.sender] = 100; // Owner starts with perfect reputation
    }

    // ============ CORE FLAG FUNCTIONS ============

    /**
     * @dev Submit a regular green or red flag
     * @param _to Address of the user being flagged
     * @param _isRedFlag True for red flag, false for green flag
     * @param _review Text review (max 200 characters)
     * @param _category Category of the flag
     * @param _severity Severity level 1-10 (only for red flags)
     */
    function submitFlag(
        address _to,
        bool _isRedFlag,
        string memory _review,
        string memory _category,
        uint8 _severity
    ) 
        public 
        onlyVerified 
        validAddress(_to) 
        hasMatchedWith(_to)
        validCategory(_category)
        returns (bytes32)
    {
        require(bytes(_review).length > 0, "Review cannot be empty");
        require(bytes(_review).length <= 200, "Review too long");

        if (_isRedFlag) {
            require(_severity >= 1 && _severity <= 10, "Red flag severity must be between 1-10");
        } else {
            _severity = 0; // Green flags don't have severity
        }

        // Generate unique flag ID using Sapphire's secure random
        bytes32 flagId = keccak256(abi.encodePacked(
            msg.sender,
            _to,
            block.timestamp,
            totalFlagsSubmitted,
            Sapphire.randomBytes(32, "flag_generation")
        ));

        FlagData memory newFlag = FlagData({
            from: msg.sender,
            to: _to,
            isRedFlag: _isRedFlag,
            review: _review,
            encryptedReview: "",
            timestamp: block.timestamp,
            isVisible: false,
            flagId: flagId,
            isEncrypted: false,
            severity: _severity,
            category: _category
        });

        userFlags[_to].push(newFlag);
        flagById[flagId] = newFlag;
        totalFlagsSubmitted++;

        // Update reputation and ratings
        _updateReputation(_to, _isRedFlag, _severity);
        _updateCategoryStats(_to, _category, _isRedFlag, _severity);
        _calculateUserRating(_to);

        emit FlagSubmitted(msg.sender, _to, _isRedFlag, flagId, _category);

        return flagId;
    }

    /**
     * @dev Submit an encrypted flag for enhanced privacy
     * @param _to Address of the user being flagged
     * @param _isRedFlag True for red flag, false for green flag
     * @param _encryptedReview Encrypted review data
     * @param _category Category of the flag
     * @param _severity Severity level 1-10 (only for red flags)
     */
    function submitEncryptedFlag(
        address _to,
        bool _isRedFlag,
        bytes memory _encryptedReview,
        string memory _category,
        uint8 _severity
    )
        public
        onlyVerified
        validAddress(_to)
        hasMatchedWith(_to)
        validCategory(_category)
        returns (bytes32)
    {
        require(_encryptedReview.length > 0, "Encrypted review cannot be empty");
        require(_encryptedReview.length <= 500, "Encrypted review too long");

        if (_isRedFlag) {
            require(_severity >= 1 && _severity <= 10, "Red flag severity must be between 1-10");
        } else {
            _severity = 0; // Green flags don't have severity
        }

        bytes32 flagId = keccak256(abi.encodePacked(
            msg.sender,
            _to,
            block.timestamp,
            totalFlagsSubmitted,
            Sapphire.randomBytes(32, "encrypted_flag")
        ));

        FlagData memory newFlag = FlagData({
            from: msg.sender,
            to: _to,
            isRedFlag: _isRedFlag,
            review: "",
            encryptedReview: _encryptedReview,
            timestamp: block.timestamp,
            isVisible: false,
            flagId: flagId,
            isEncrypted: true,
            severity: _severity,
            category: _category
        });

        userFlags[_to].push(newFlag);
        flagById[flagId] = newFlag;
        totalFlagsSubmitted++;

        _updateReputation(_to, _isRedFlag, _severity);
        _updateCategoryStats(_to, _category, _isRedFlag, _severity);
        _calculateUserRating(_to);

        emit EncryptedFlagSubmitted(msg.sender, _to, _isRedFlag, flagId);

        return flagId;
    }

    /**
     * @dev Submit an anonymous flag (sender identity hidden until approval)
     * @param _to Address of the user being flagged
     * @param _isRedFlag True for red flag, false for green flag
     * @param _review Text review
     * @param _category Category of the flag
     * @param _severity Severity level 1-10 (only for red flags)
     */
    function submitAnonymousFlag(
        address _to,
        bool _isRedFlag,
        string memory _review,
        string memory _category,
        uint8 _severity
    )
        public
        onlyVerified
        validAddress(_to)
        hasMatchedWith(_to)
        validCategory(_category)
        returns (bytes32)
    {
        require(bytes(_review).length > 0, "Review cannot be empty");
        require(bytes(_review).length <= 200, "Review too long");

        if (_isRedFlag) {
            require(_severity >= 1 && _severity <= 10, "Red flag severity must be between 1-10");
        } else {
            _severity = 0; // Green flags don't have severity
        }

        bytes32 flagId = keccak256(abi.encodePacked(
            msg.sender,
            _to,
            block.timestamp,
            totalFlagsSubmitted,
            Sapphire.randomBytes(32, "anonymous_flag")
        ));

        // Encrypt sender identity
        bytes memory encryptedSender = abi.encodePacked(
            keccak256(abi.encodePacked(
                msg.sender,
                Sapphire.randomBytes(32, "sender_encryption")
            ))
        );

        FlagData memory newFlag = FlagData({
            from: address(0), // Hide sender initially
            to: _to,
            isRedFlag: _isRedFlag,
            review: _review,
            encryptedReview: encryptedSender, // Store encrypted sender info
            timestamp: block.timestamp,
            isVisible: false,
            flagId: flagId,
            isEncrypted: true,
            severity: _severity,
            category: _category
        });

        userFlags[_to].push(newFlag);
        flagById[flagId] = newFlag;
        totalFlagsSubmitted++;

        _updateReputation(_to, _isRedFlag, _severity);
        _updateCategoryStats(_to, _category, _isRedFlag, _severity);
        _calculateUserRating(_to);

        emit AnonymousFlagSubmitted(_to, _isRedFlag, flagId, _category);

        return flagId;
    }

    // ============ FLAG APPROVAL FUNCTIONS ============

    /**
     * @dev Approve a flag to make it visible
     * @param _flagId Unique identifier of the flag
     */
    function approveFlag(bytes32 _flagId) public {
        FlagData storage flag = flagById[_flagId];
        require(flag.to == msg.sender, "Can only approve flags about yourself");
        require(!flag.isVisible, "Flag already approved");

        flag.isVisible = true;

        // Update the flag in userFlags array as well
        for (uint i = 0; i < userFlags[msg.sender].length; i++) {
            if (userFlags[msg.sender][i].flagId == _flagId) {
                userFlags[msg.sender][i].isVisible = true;
                break;
            }
        }

        totalFlagsApproved++;

        emit FlagApproved(msg.sender, _flagId, msg.sender);
    }

    /**
     * @dev Batch approve multiple flags
     * @param _flagIds Array of flag IDs to approve
     */
    function batchApproveFlags(bytes32[] memory _flagIds) public {
        for (uint i = 0; i < _flagIds.length; i++) {
            approveFlag(_flagIds[i]);
        }
    }

    // ============ VIEW FUNCTIONS ============

    /**
     * @dev Get all flags for a user (visible only)
     * @param _user Address of the user
     * @return Array of visible flags
     */
    function getVisibleFlags(address _user) public view returns (FlagData[] memory) {
        uint256 visibleCount = 0;

        // Count visible flags
        for (uint i = 0; i < userFlags[_user].length; i++) {
            if (userFlags[_user][i].isVisible) {
                visibleCount++;
            }
        }

        FlagData[] memory visibleFlags = new FlagData[](visibleCount);
        uint256 index = 0;

        // Populate visible flags
        for (uint i = 0; i < userFlags[_user].length; i++) {
            if (userFlags[_user][i].isVisible) {
                visibleFlags[index] = userFlags[_user][i];
                index++;
            }
        }

        return visibleFlags;
    }

    /**
     * @dev Get visible red flags for a user
     * @param _user Address of the user
     * @return Array of visible red flags
     */
    function getVisibleRedFlags(address _user) public view returns (FlagData[] memory) {
        FlagData[] memory allVisible = getVisibleFlags(_user);
        uint256 redCount = 0;

        // Count red flags
        for (uint i = 0; i < allVisible.length; i++) {
            if (allVisible[i].isRedFlag) {
                redCount++;
            }
        }

        FlagData[] memory redFlags = new FlagData[](redCount);
        uint256 index = 0;

        // Populate red flags
        for (uint i = 0; i < allVisible.length; i++) {
            if (allVisible[i].isRedFlag) {
                redFlags[index] = allVisible[i];
                index++;
            }
        }

        return redFlags;
    }

    /**
     * @dev Get visible green flags for a user
     * @param _user Address of the user
     * @return Array of visible green flags
     */
    function getVisibleGreenFlags(address _user) public view returns (FlagData[] memory) {
        FlagData[] memory allVisible = getVisibleFlags(_user);
        uint256 greenCount = 0;

        // Count green flags
        for (uint i = 0; i < allVisible.length; i++) {
            if (!allVisible[i].isRedFlag) {
                greenCount++;
            }
        }

        FlagData[] memory greenFlags = new FlagData[](greenCount);
        uint256 index = 0;

        // Populate green flags
        for (uint i = 0; i < allVisible.length; i++) {
            if (!allVisible[i].isRedFlag) {
                greenFlags[index] = allVisible[i];
                index++;
            }
        }

        return greenFlags;
    }

    /**
     * @dev Get flag statistics for a user
     * @param _user Address of the user
     * @return FlagStats structure with statistics
     */
    function getFlagStatistics(address _user) public view returns (FlagStats memory) {
        uint256 total = userFlags[_user].length;
        uint256 red = 0;
        uint256 green = 0;
        uint256 visible = 0;
        uint256 pending = 0;
        uint256 totalRating = 0;
        uint256 ratingCount = 0;

        for (uint i = 0; i < total; i++) {
            FlagData memory flag = userFlags[_user][i];

            if (flag.isVisible) {
                visible++;
                if (flag.isRedFlag) {
                    red++;
                    totalRating += (11 - flag.severity); // Invert severity for rating
                    ratingCount++;
                } else {
                    green++;
                    totalRating += 10; // Green flags contribute max rating
                    ratingCount++;
                }
            } else {
                pending++;
            }
        }

        uint256 avgRating = ratingCount > 0 ? totalRating / ratingCount : 0;

        return FlagStats({
            totalFlags: total,
            redFlags: red,
            greenFlags: green,
            visibleFlags: visible,
            pendingFlags: pending,
            averageRating: avgRating
        });
    }

    /**
     * @dev Get flag by ID with privacy controls
     * @param _flagId Unique identifier of the flag
     * @param _requester Address requesting the flag
     * @return FlagData structure
     */
    function getFlagById(bytes32 _flagId, address _requester) public view returns (FlagData memory) {
        FlagData memory flag = flagById[_flagId];
        require(flag.flagId != bytes32(0), "Flag not found");

        // Only recipient or sender can view the flag
        require(
            flag.to == _requester || flag.from == _requester,
            "Access denied"
        );

        return flag;
    }

    // ============ UTILITY FUNCTIONS ============

    /**
     * @dev Generate secure encryption seed using Sapphire
     * @return bytes32 encryption seed
     */
    function generateEncryptionSeed() public view returns (bytes32) {
        return keccak256(abi.encodePacked(
            block.timestamp,
            msg.sender,
            Sapphire.randomBytes(32, "encryption_seed")
        ));
    }

    /**
     * @dev Encrypt flag review data
     * @param _review Review text to encrypt
     * @param _key Encryption key
     * @return bytes Encrypted data
     */
    function encryptFlagReview(string memory _review, bytes32 _key) public pure returns (bytes memory) {
        return abi.encodePacked(keccak256(abi.encodePacked(_review, _key)));
    }

    /**
     * @dev Check if category is valid
     * @param _category Category string to validate
     * @return bool True if valid category
     */
    function isValidCategory(string memory _category) public view returns (bool) {
        for (uint i = 0; i < flagCategories.length; i++) {
            if (keccak256(bytes(flagCategories[i])) == keccak256(bytes(_category))) {
                return true;
            }
        }
        return false;
    }

    /**
     * @dev Get all available flag categories
     * @return string[] Array of valid categories
     */
    function getFlagCategories() public view returns (string[] memory) {
        return flagCategories;
    }

    // ============ ADMIN FUNCTIONS ============

    /**
     * @dev Verify a user (only owner)
     * @param _user Address of user to verify
     */
    function verifyUser(address _user) public onlyOwner {
        isVerifiedUser[_user] = true;
        userReputation[_user] = 50; // Start with neutral reputation
        emit UserVerified(_user);
    }

    /**
     * @dev Create a match between two users (only owner)
     * @param _user1 First user address
     * @param _user2 Second user address
     */
    function createMatch(address _user1, address _user2) public onlyOwner {
        require(_user1 != _user2, "Cannot match user with themselves");
        require(isVerifiedUser[_user1] && isVerifiedUser[_user2], "Both users must be verified");

        hasMatched[_user1][_user2] = true;
        hasMatched[_user2][_user1] = true;

        emit MatchCreated(_user1, _user2);
    }

    /**
     * @dev Add new flag category (only owner)
     * @param _category New category to add
     */
    function addFlagCategory(string memory _category) public onlyOwner {
        require(bytes(_category).length > 0, "Category cannot be empty");
        require(!isValidCategory(_category), "Category already exists");

        flagCategories.push(_category);
    }

    /**
     * @dev Get contract statistics
     * @return total flags, approved flags, total users
     */
    function getContractStats() public view returns (uint256, uint256, uint256) {
        return (totalFlagsSubmitted, totalFlagsApproved, flagCategories.length);
    }

    // ============ RATING SYSTEM FUNCTIONS ============

    /**
     * @dev Get comprehensive user rating with category breakdowns
     * @param _user Address of the user
     * @return UserRating structure with detailed ratings
     */
    function getUserRating(address _user) public view returns (UserRating memory) {
        return userRatings[_user];
    }

    /**
     * @dev Get category-specific statistics for a user
     * @param _user Address of the user
     * @param _category Category to get stats for
     * @return CategoryStats structure
     */
    function getCategoryStats(address _user, string memory _category) public view returns (CategoryStats memory) {
        return userCategoryStats[_user][_category];
    }

    /**
     * @dev Get all users with a specific rating tier
     * @param _tier Rating tier ("Excellent", "Good", "Average", "Poor", "Dangerous")
     * @return Array of user addresses in that tier (simplified implementation)
     */
    function getUsersByRatingTier(string memory _tier) public view returns (address[] memory) {
        // Note: This is a simplified implementation for demonstration
        // In production, you'd want to maintain separate arrays for each tier
        address[] memory emptyArray = new address[](0);
        return emptyArray;
    }

    /**
     * @dev Get recommended users for matching (high rating users)
     * @return Array of recommended user addresses
     */
    function getRecommendedUsers() public view returns (address[] memory) {
        // Note: This is a simplified implementation
        // In production, you'd maintain a separate array of recommended users
        address[] memory emptyArray = new address[](0);
        return emptyArray;
    }

    /**
     * @dev Get flag type distribution for analytics
     * @param _user Address of the user
     * @return categories Arrays of categories
     * @return redCounts Red flag counts per category  
     * @return greenCounts Green flag counts per category
     */
    function getFlagTypeDistribution(address _user) public view returns (
        string[] memory categories,
        uint256[] memory redCounts,
        uint256[] memory greenCounts,
        uint256[] memory categoryScores
    ) {
        categories = new string[](flagCategories.length);
        redCounts = new uint256[](flagCategories.length);
        greenCounts = new uint256[](flagCategories.length);
        categoryScores = new uint256[](flagCategories.length);

        for (uint i = 0; i < flagCategories.length; i++) {
            string memory category = flagCategories[i];
            CategoryStats memory stats = userCategoryStats[_user][category];

            categories[i] = category;
            redCounts[i] = stats.redCount;
            greenCounts[i] = stats.greenCount;
            categoryScores[i] = stats.categoryScore;
        }

        return (categories, redCounts, greenCounts, categoryScores);
    }

    // ============ INTERNAL FUNCTIONS ============

    /**
     * @dev Update user reputation based on flag
     * @param _user User whose reputation to update
     * @param _isRedFlag Whether it's a red flag
     * @param _severity Severity of the flag
     */
    function _updateReputation(address _user, bool _isRedFlag, uint8 _severity) internal {
        if (_isRedFlag) {
            // Red flags decrease reputation based on severity
            uint256 decrease = _severity * 2;
            if (userReputation[_user] > decrease) {
                userReputation[_user] -= decrease;
            } else {
                userReputation[_user] = 0;
            }
        } else {
            // Green flags increase reputation
            userReputation[_user] += 5;
            if (userReputation[_user] > 100) {
                userReputation[_user] = 100; // Cap at 100
            }
        }

        emit ReputationUpdated(_user, userReputation[_user]);
    }

    /**
     * @dev Update category-specific statistics for a user
     * @param _user User whose stats to update
     * @param _category Category of the flag
     * @param _isRedFlag Whether it's a red flag
     * @param _severity Severity of the flag (for red flags)
     */
    function _updateCategoryStats(address _user, string memory _category, bool _isRedFlag, uint8 _severity) internal {
        CategoryStats storage stats = userCategoryStats[_user][_category];

        stats.totalCount++;

        if (_isRedFlag) {
            stats.redCount++;
            // Update average severity
            if (stats.redCount == 1) {
                stats.averageSeverity = _severity;
            } else {
                stats.averageSeverity = (stats.averageSeverity * (stats.redCount - 1) + _severity) / stats.redCount;
            }
        } else {
            stats.greenCount++;
        }

        // Calculate category score (0-100)
        if (stats.totalCount > 0) {
            uint256 positiveRate = (stats.greenCount * 100) / stats.totalCount;
            uint256 severityPenalty = stats.redCount > 0 ? (stats.averageSeverity * stats.redCount * 5) / stats.totalCount : 0;

            if (positiveRate > severityPenalty) {
                stats.categoryScore = positiveRate - severityPenalty;
            } else {
                stats.categoryScore = 0;
            }

            if (stats.categoryScore > 100) {
                stats.categoryScore = 100;
            }
        }

        emit CategoryScoreUpdated(_user, _category, stats.categoryScore);
    }

    /**
     * @dev Calculate comprehensive user rating based on all flags
     * @param _user User whose rating to calculate
     */
    function _calculateUserRating(address _user) internal {
        UserRating storage rating = userRatings[_user];

        uint256 totalFlags = userFlags[_user].length;
        if (totalFlags == 0) {
            // New user - set default values
            rating.overallScore = 50;
            rating.safetyScore = 50;
            rating.behaviorScore = 50;
            rating.communicationScore = 50;
            rating.kindnessScore = 50;
            rating.reliabilityScore = 50;
            rating.ratingTier = "New User";
            rating.totalInteractions = 0;
            rating.positivePercentage = 0;
            rating.isRecommended = false;
            return;
        }

        uint256 visibleFlags = 0;
        uint256 greenFlags = 0;
        uint256 redFlags = 0;
        uint256 totalSeverity = 0;

        // Count visible flags and calculate basic stats
        for (uint i = 0; i < totalFlags; i++) {
            if (userFlags[_user][i].isVisible) {
                visibleFlags++;
                if (userFlags[_user][i].isRedFlag) {
                    redFlags++;
                    totalSeverity += userFlags[_user][i].severity;
                } else {
                    greenFlags++;
                }
            }
        }

        if (visibleFlags == 0) {
            rating.totalInteractions = totalFlags;
            rating.positivePercentage = 0;
            rating.overallScore = 50; // Neutral for no visible flags
            rating.ratingTier = "Unrated";
            rating.isRecommended = false;
            return;
        }

        // Calculate category-specific scores
        rating.safetyScore = userCategoryStats[_user]["safety"].categoryScore;
        rating.behaviorScore = userCategoryStats[_user]["behavior"].categoryScore;
        rating.communicationScore = userCategoryStats[_user]["communication"].categoryScore;
        rating.kindnessScore = userCategoryStats[_user]["kindness"].categoryScore;
        rating.reliabilityScore = userCategoryStats[_user]["reliability"].categoryScore;

        // Calculate overall metrics
        rating.totalInteractions = visibleFlags;
        rating.positivePercentage = (greenFlags * 100) / visibleFlags;

        // Calculate overall score (weighted average of category scores and flag ratio)
        uint256 categoryAverage = (rating.safetyScore + rating.behaviorScore + rating.communicationScore + 
                                 rating.kindnessScore + rating.reliabilityScore) / 5;

        uint256 flagRatioScore = rating.positivePercentage;

        // Apply severity penalty for red flags
        uint256 severityPenalty = 0;
        if (redFlags > 0) {
            uint256 avgSeverity = totalSeverity / redFlags;
            severityPenalty = (avgSeverity * redFlags * 3) / visibleFlags; // Severity penalty
        }

        // Weighted combination: 60% category scores, 40% flag ratio
        rating.overallScore = (categoryAverage * 60 + flagRatioScore * 40) / 100;

        if (rating.overallScore > severityPenalty) {
            rating.overallScore -= severityPenalty;
        } else {
            rating.overallScore = 0;
        }

        // Determine rating tier
        if (rating.overallScore >= 90) {
            rating.ratingTier = "Excellent";
            rating.isRecommended = true;
        } else if (rating.overallScore >= 75) {
            rating.ratingTier = "Good";
            rating.isRecommended = true;
        } else if (rating.overallScore >= 50) {
            rating.ratingTier = "Average";
            rating.isRecommended = false;
        } else if (rating.overallScore >= 25) {
            rating.ratingTier = "Poor";
            rating.isRecommended = false;
        } else {
            rating.ratingTier = "Dangerous";
            rating.isRecommended = false;
        }

        // Update timestamp
        lastRatingUpdate[_user] = block.timestamp;

        emit RatingUpdated(_user, rating.overallScore, rating.ratingTier);
        emit RecommendationStatusChanged(_user, rating.isRecommended);
    }
}

